CREATE DEFINER=`root`@`localhost` FUNCTION `calcular_cantidad_productos`(venta_folio INT) RETURNS int
    DETERMINISTIC
BEGIN
    DECLARE cantidad INT;
    SELECT SUM(dv.cantidad) INTO cantidad
    FROM detalle_venta dv
    WHERE dv.idVenta = venta_folio;
    RETURN cantidad;
END ;;
